import axios from 'axios'
const S1 = (Com) => {
    function Hoc(props) {

        function load(key) {
            const data = localStorage.getItem(key)
            return data ? JSON.parse(data) : []
        }
        function fall() {
            axios.get('http://localhost:8080/GameS/getAll')
                .then((x => {
                    console.log(x.data);
                    localStorage.setItem('game', JSON.stringify(x.data))
                }))
                .catch((err) => console.log(err))
        }

        <Com
            {...props}
            load={load}
            fall={fall}

        ></Com>
    }
    return Hoc
}; export default S1
